lspath (){
   for p in $* ; do
      TP=$(echo $p |sed 's/^\(.\).*$/\1/g')
      if [ "$TP" = "/" ] ; then
         echo $p
      else
         echo $(pwd -P)/$p
      fi
   done
}
make_source_from_htk (){
   local FP2TK=$(lspath $0)
   local HPSCD=hyperf_source_code
   if ! mkdir $HPSCD ; then
      echo Unable to make $HPSCD. Exiting...
      exit
   fi
   extract_source_items_and_set_sidir
   pushd $HPSCD &>$DN
   mkdir configs controller cqt grouper
   mv ${SIDIR}${MDIR}/lib/{freecans,demo_system} .
   local ESIZE="$(($(grep -n "^#BEGIN_YOLK_${MPLD}" $FP2TK | cut -d":" -f1)-2))"
   head -${ESIZE} $FP2TK | sed 's/^# htk.sh--.*$/# htk.sh/g' > controller/hyperf.sh
   mv freecans/HYPERF.{BASHRC.sh,PROJECT.template,VIMDIFF.vim} configs
   mv freecans/HYPERF.{ENVIRONMENT.README,INPUTRC.sh,VIMRC.vim} configs
   mv freecans/{dot.bashrc.sh,EXAMPLE.CYGWIN.BASHRC.sh,debug.vimrc} configs
   mv freecans/cqt.sh cqt
   mv freecans/grouper.sh grouper
   mv ${SIDIR}${MDIR}/lib/precans . 2>$DN
   mv ${SIDIR}${MDIR}/lib/funcs ./libs
   mv ${SIDIR}${DOCDIR} ./documentation
   mkdir jail_tools jic plush release sync license
   mv freecans/jail_tools*.tgz jail_tools
   mv freecans/jic.sh jic
   mv freecans/plush.profile plush
   ln -s freecans/htk_development_launcher_scriptlet ./.htk_development_launcher_scriptlet
   cp documentation/LICENSE license/hyperf.copyright.license
   safely_remove_extraction_directory $SIDIR
   popd &>$DN
   echo "                                              ------------------"
   echo "Source items should now be extracted here --> $(ls -d $HPSCD)"
   echo "                                              ------------------"
}
htk_install (){
   htk_mgmt_action ins
}
table_mode_loop_run (){
   GLOBIGNORE=*
   for i in $(cat $MLST);do
      echo -n "$i "
      $1
   done|tr -s " "|column -t -s" "
   unset GLOBIGNORE
}
noisy_mode_loop_run (){
   GLOBIGNORE=*
   for i in $(cat $MLST);do
      echo $i
      $1
   done
   unset GLOBIGNORE
}
process_htk_mgmt_options (){
   while getopts ":l:U:u:i" OPTION ;do
      case $OPTION in
         i) htk_install ;;
         l) MLST=$OPTARG ;;
         U|u) USR=$OPTARG ;;
      *) cON
         case $@ in
            -v|--vers*)
               show_htk_version
               exit
               ;;
            -*help*|-*usag*)
               show_appropriate_help $@
               exit
               ;;
            *-browse*)
               payload_browser $2
               exit
               ;;
            *-extract*)
               payload_extractor $2
               exit
               ;;
            --reconstruct-source-code)
               make_source_from_htk
               exit
               ;;
            --full-auto-install-upg)
               FULLAUTO=yes
               mupg
               exit
               ;;
            --full-auto-mobile-home-client-install*|--famhcli*|--mhcli*)
               full_auto_mobile_home_client_install $2
               exit
               ;;
            --full-auto-uninstall)
               full_auto_uninstall
               exit
               ;;
            --full-auto-complete-hyperf-purge)
               completely_purge_hyperf_from_system
               exit
               ;;
            *-inst*)
               htk_install
               exit
               ;;
            -*upg*)
               mupg
               exit
               ;;
            *-uninst*)
               prompt_to_perform_uninstallation_or_do_nothing
               exit
               ;;
         esac
         cOFF
         ;;
      esac
   done
   shift $(($OPTIND-1))
   CMD_LN=$@
   SRC=$1
   DST=$2
}
prompt_to_perform_uninstallation_or_do_nothing (){
   local THSBL
   echo "Are you sure you want to uninstall the HyPerf framework?"
   echo
   echo -n "[n]  "
   read THSBL
   test -z $THSBL 2>$DN && THSBL=n
   case $THSBL in
      y*|sure|ok|do\ it*|go*) munst ; exit ;;
      *) echo Exiting without uninstallation... ;;
   esac
}
munst (){
   echo "---------------------------"
   echo "REMOVING LINKS IN $IDIR"
   echo "---------------------------"
   cd $IDIR
   find -samefile $MVL |grep -v $(basename $MVL) |xargs -i rm {}
   echo "--------------------------------------------"
   echo "         -------"
   echo "REMOVING EXECUTE BIT FROM $MVL"
   echo "         -------"
   echo "--------------------------------------------"
   echo "=============================="
   echo "HYPERF UNINSTALLATION COMPLETE"
   echo "=============================="
   chmod -x $MVL
}
mupg (){
   htk_mgmt_action upg
}
payload_browser (){
   # Takes 1 arg:       Arg 1 is pattern to search for among payload pathnames.
   #
   # This function finds, extracts, decodes and displays a file listing from
   # the standard HTK payload, for the user, to allow them to see what is
   # included therein.  The single optional argument allows the user to search
   # for a pattern to display from the payload.
   (echo "Here is a list of the files you requested to view from the payload:"
    echo "==================================================================="
    echo "               (Tap the Q key to exit.)"
 
   yolk_2_stdout $MPLD $0 |tar -ztf - --wildcards \*$1\* ) 2>$DN| less
}
payload_extractor (){
   # Takes 1 arg:       Arg 1 is an optional pattern to search for among
   #                    payload pathnames.  
   #
   # This function finds, extracts, decodes and displays files and directories
   # from the standard HTK payload, for the user, to allow them to explore what
   # is included therein.  The single optional argument allows the user to
   # search for a pattern to extract from the payload.
   local MYTMP=$(mktemp -d /tmp/htk.XXX)
   #
   #
   ########################## old code #########################################
   #############################################################################
   #yolk_2_stdout $MPLD $0 |tar -zxf - -C $MYTMP --wildcards \*$1\* 2>$DN
   #############################################################################
   ########################## old code #########################################
   #
   #
   extract_yolk_by_pattern_1__from__file_2 $MPLD $0 | \
      tar -zxf - -C $MYTMP --wildcards \*${1}\* 2>$DN
   clear
   echo "Here is a listing of your extracted files:"
   echo -e "------------------------------------------\n"
   find $MYTMP -type f | sed 's/\/tmp\/htk\....\///g'
   echo -e "\n==========================================="
   echo "Your files are extracted here: $MYTMP"
   echo "==========================================="
}
